import styled from "styled-components";

export const StyledPageContainer = styled.div`
  margin-left: 5vw;
  transition: all 0.3s ease;
`;

export const StyledPageContainerQuery = styled.div`
  transition: all 0.3s ease;
  display:flex;
  flex-direction: row;
`;

export const StyledHeaderDiv = styled.div`
  padding: 1%;
  margin: auto;
  display: flex;
  flex-direction: column;
  justify-content: center;
`;
export const StyledHeaderDivQuery = styled.div`
  width: 30%;
  padding: 1%;
  margin: auto;
  display: flex;
  flex-direction: column;
  justify-content: center;
`;
